import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useLocation } from "react-router-dom";

export default function ListingPage(){
    const SearchResults = () => {
        const location = useLocation();
        const searchResults = location.state.searchResults;
      
        return (
          <div>
            {searchResults.map((result: { id: React.Key | null | undefined; title: string | number | boolean | React.ReactElement<any, string | React.JSXElementConstructor<any>> | React.ReactFragment | React.ReactPortal | null | undefined; }) => (
              <p key={result.id}>{result.title}</p>
            ))}
          </div>
        );
      };
}
